import React from 'react';
import Style from './Module.portfolio.css'

function Portfolio() {
  return (
    <div>
      <div className={Style.navbar_fundo}>
        <nav>
          <ul className="navbar">
            <li><a href="#hi-word">Hi Word</a></li>
            <li><a href="#quem-sou-eu">Quem sou eu</a></li>
            <li><a href="#conhecimentos">Conhecimentos</a></li>
            <li><a href="#redes">Redes</a></li>
          </ul>
        </nav>
      </div>
      {/* Conteúdo do seu site aqui */}
    </div>
  );
}

export default Portfolio;
